            <div className="container my-4">
                <h1 className="my-4">NewsMonkey - Top Headlines</h1>
                <div className="row">
                    <div className="col-md-4">
                        <NewsItem title="myTitle" description="myDesc" imgUrl="https:////m.files.bbci.co.uk/modules/bbc-morph-sport-seo-meta/1.23.3/images/bbc-sport-logo.png" />
